"use strict";zeus.page({initDatas:function(){self.list=[]},initParts:function(){var t=this;t.setPic()},bindEvent:function(){$(".submit").on("click",function(){var t=$.trim($(".search").val());return""!=t&&void(window.location.href="/search?word="+t)})},setPic:function(){for(var t=$(".load-pic"),i=0;i<t.length;i++){var n=$(t[i]),e=n.data("src");n.attr("src",e),n.removeClass(".load-pic")}},getNewList:function(){var t=$("#infiniteList .channel-item").length/50;$.ajax({url:"/home/list?start="+t,type:"GET",dataType:"json",success:function(t){$("#listTemp").tmpl(t.data).appendTo("#infiniteList"),self.setPic()}})}});